 import React from "react";
import Avatar from "./AvaDecr/Avatar";
import NewPost from "./New post/NewPost";

const Profile = (props) => {

    return (
        <div>
            <Avatar />
            <NewPost state={props.state.profilePage}
                     dispatch={props.dispatch}/>
        </div>
    );
}

export default Profile;
